import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () =>{
    return(
        <>
        <div className="header">
        <div className="box_center">
        <ol>
            <NavLink exact activeClassName="Linkhover" to='/'><li>Main page </li></NavLink>
            <NavLink exact activeClassName="Linkhover" to='/1'><li>Comment Box  </li></NavLink>
            <NavLink exact activeClassName="Linkhover" to='/2'><li>Note Box </li></NavLink>
          </ol>
        </div>
        </div>
        </>
    );
};
export default Menu;
